(1) \begin{equation*}p(x) = \int p(x,z) dz = \int p(x|z)p(z) dz.\end{equation*}
The challenge is now to find a good approximation of the posterior distribution p(z|x) . Once we have it, we can use it to approximate the integral in Eq. 1 using Monte Carlo samples from p(z|x) . The variational autoencoder (VAE) is one of the most famous probabilistic autoencoders. It approximates p(z|x) with a variational distribution q(z|x) . The main idea is to make q(z|x) as similar as possible to p(z|x) . This is done by minimizing the KL

